INSERT INTO dima."tblMaintCarbonateStage" ("Stage", "Gravelly", "Nongravelly") VALUES 
(0, E'No Carbonates', E'No Carbonates'),
(1, E'Thin discontinuous clast coatings, some filaments, matrix can be calcareous next tto stones, about 4% CaCO3', E'Few filaments or coatings on sand grains, <10% CaCO3'),
(2, E'Continous clast coatings, local cementation of few to several clasts, matrix is loose and calcareous enough to give somewhat whitened appearance', E'Few to common nodules, matrix between nodules is slightly whitened by carbonate (15-50% by area), and the latter occurs in veinlets and as filaments, some matrix can be noncalcareous, about 10-15% CaCO3 in whole sample, 15-75% in nodules'),
(3, E'Horizon has 50-90% K fabric with carbonate forming an essentially continuous medium, color mostly white, carbonate-rich layers more common in upper part, about 20-25% CaCO3', E'Many nodules, and carbonate coats so many grains that over 90% of horizon is white, carbonate-rich layers more common in upper part, about 20% CaCO3'),
(4, E'Upper part of K horizon is nearly pure cemented carbonate (75-90% CaCO3) and has a weak platy structure due to the weakly expressed laminar depositional layers of carbonate, the rest of the horizon is plugged with carbonate (50-75% CaCO3)', E'Upper part of K horizon is nearly pure cemented carbonate (75-90% CaCO3) and has a weak platy structure due to the weakly expressed laminar depositional layers of carbonate, the rest of the horizon is plugged with carbonate (50-75% CaCO3)');
