INSERT INTO dima."tblMaintSurfaceSoilProperties" ("Abbrev", "Description", "Sort") VALUES 
(E'CB', E'Cracking or curling, rubbery algal crust, with or without lichen.', 10),
(E'CEM', E'Cemented horizon exposed at surface.', 6),
(E'D', E'Duff; non-decomposed to fully decomposed plant and organic matter located above the A horizon (a patchy or continuous O horizon).', 13),
(E'DP', E'Desert pavement; a concentration of closely packed and varnished rock fragments at the soil surface, embedded in a vesicular crust.', 12),
(E'EP', E'Erosion pavement; a lag of rock fragments remaining after erosion and removal of finer soil material, forming a dense uniform pavement; individual fragments may be displaced during runoff events.', 11),
(E'PDB', E'Poorly developed biological crust, dense cyanobacterial sheaths form a smooth or dimpled crust of variable darkness; can include other functional/structural groups (algae, lichen, moss).', 8),
(E'RM', E'Rock mulch with stable soil; surface soil material is trapped and protected by closely spaced and partially embedded rock fragments (mostly cobbles and larger) or intermingled with bedrock.', 3),
(E'S', E'Bare single grain soil; pedoderm is characterized by bare mineral soil and no other class.', 1),
(E'SA', E'Soil aggregates; well-formed or distinct structural aggregates at the soil surface and no other pedoderm class (well aggregated, but not platy, stable soils).', 2),
(E'SC', E'Salt crust of fine to extremely coarse evaporite crystals or visible whitening on the soil surface; may include biological components.', 7),
(E'SDB', E'Strongly developed biological crust, typically two or more functional/structural groups (cyanobacteria, algae, moss, lichen) form a rugose, pinnacled or rolling crust.', 9),
(E'SP', E'Strong physical crust; usually platy or massive, no substantial biological component.', 5),
(E'WP', E'Weak physical or biological crust; none to few cyanobacterial sheaths dangling from ped, no darkening from cyanobacteria.', 4);
